settings\u0004Language-server specific c:
Konfiguracja dla poszczególnych serwerów językowych, gdzie klucze korespondują do implementacji serwera, na przykład:

pyls: {
  serverSettings: {
    pyls: {
      plugins: {
        pydocstyle: {
          enabled: true
        }
        płatki: {
          enabled: false
        },
        płatki8: {
          enabled: true
        }
      }
    }
  }
}

Alternatywnie, używając konwencji nazw VSCode:

pyls: {
  serverSettings: {
    "pyls. lugins.pydocstyle.enabled": true,
    "pyls.plugins.pyflakes.enabled": false,
    "pyls.plugins.flake8.enabled": true
  }
}
